  const { slug } = router.query

  return (
    <div id='container'>
      <h1>tweet-img</h1>
      <form>
        <label>Tweet URL</label>
        <input id='url-input'type='text' name='url' placeholder='twitter.com/tweeturl'/>
        <input type="submit" value="Submit"/>
